  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Find Shortage Areas: Health Professional
  Shortage Area (HPSA) and Medically Underserved Area/Population (MUA/P) by Address
  tool is a locator tool designed to help our users determine if a specific address
  is located in a Primary Care HPSA, Mental Health HPSA, Dental Care HPSA, and/or
  MUA/P. These HPSAs and MUA/Ps are those areas designated by HRSA with the in greatest
  need for health care, those areas having: shortages of primary medical care, dental
  or mental health providers, low income populations, high infant mortality, high
  poverty population, high elderly population. The returned search results provide
  indications of whether the address is in a Primary Care HPSA, Mental Health HPSA,
  Dental Care HPSA, and MUA/P; state name; county name; county subdivision name; Census
  Tract Number; ZIP Code; post office name; congressional district; congressional
  district representative; and a map identifying the entered address. The interface
  makes available three other locator tools (HPSA by State and County; HPSAs Eligible
  for the Medicare Physician Bonus Payment; and MUA/P by State and County).</p>n\",\n\t\"license_title\":
